import React from "react";
import {AppBar, Button, Grid, Toolbar} from "@mui/material";

const Navbar = () => {
    return (
        <AppBar position="static" color={'primary'}>
            <Toolbar>
                <Grid container justify={'flex-end'}>
                    <Button/>
                </Grid>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar;
